import { useSelector } from "react-redux";
import { RootState } from "../store/store";
import { Checkbox } from "antd";
import type { CheckboxProps } from "antd";

export function SideNavigation() {
  const filterData = useSelector((state: RootState) => state.filter);

  const onChange: CheckboxProps["onChange"] = (e) => {
    console.log(`checked = ${e.target.checked}`);
  };

  return (
    <aside className="w-64 pr-4 m-4 p-4 rounded-[16px] bg-[#f3f5f6]">
      <form className="flex flex-col gap-6">
        {filterData.map((filterCatagory, idx) => {
          switch (filterCatagory.input_type) {
            // case "checkbox":
            //   return (
            //     <div key={idx} className= "pb-3">
            //       <p className="text-sm font-medium text-gray-700 mb-2">
            //         {filterCatagory.type}
            //       </p>
            //       <div className="flex flex-col gap-1">
            //         {filterCatagory.options.map((option, oIdx) => (
            //           <Checkbox
            //             key={oIdx}
            //             onChange={onChange}
            //             className="text-sm"
            //           >
            //             {option.text}
            //           </Checkbox>
            //         ))}
            //       </div>
            //     </div>
            //   );

            case "link_with_icon":
              return (
                <div key={idx} className="border-b border-gray-100 pb-3">
                  <p className="text-base font-medium text-gray-700 mb-2">
                    Refine Results
                  </p>
                  <div className="flex flex-col gap-1">
                    {filterCatagory.options.map((option, oIdx) => (
                      <a
                        href="#"
                        key={oIdx}
                        className="text-neutral-600 text-sm"
                      >
                        {option.text}
                      </a>
                    ))}
                  </div>
                </div>
              );

            case "link":
            case "price_range":
            case "checkbox":
              return (
                <div key={idx} className="border-b border-gray-100 pb-3">
                  <p className="text-base font-medium text-gray-700 mb-2">
                    {filterCatagory.type}
                  </p>
                  <div className="flex flex-col gap-1">
                    {filterCatagory.options.map((option, oIdx) => (
                      <a
                        href="#"
                        key={oIdx}
                        className="text-neutral-500 text-sm"
                      >
                        {option.text}
                      </a>
                    ))}
                  </div>
                </div>
              );
            case "color":
              return (
                <div key={idx} className="border-b border-gray-100 pb-3">
                  <p className="text-base font-medium text-gray-700 mb-2">
                    {filterCatagory.type}
                  </p>
                  <div className="flex flex-col gap-1">
                    {filterCatagory.options.map((option, oIdx) => (
                      <a
                        href="#"
                        key={oIdx}
                        className="text-neutral-600 text-sm"
                      >
                        {option.text}
                      </a>
                    ))}
                  </div>
                </div>
              );
            default:
              return null;
          }
        })}
      </form>
    </aside>
  );
}
